1910 Fruitgum Co. - Simon Says [promo].VOB



Very HQ promo music video. Simon Says is the first album by American bubblegum pop group the 1910 Fruitgum Company on the Buddah Records label. Released in 1968, it included two songs that appeared on the Billboard Top 100, the most from any of the group's albums, although it was not their highest-charting album. 

It's been debated whether or not the members of the band actually played on the album since the Ohio Express, another band put together by Super K Productions (headed by Jerry Kasenetz and Jeff Katz), actually consisted of two groups: one that produced the records and another that toured and promoted the name. This is countered by original drummer Floyd Marcus, who has stated that all five men listed really were behind the instruments.

The album cover featured film strips from a photo shoot of the band members, a design that presumably inspired the cover of Swedish pop group Secret Service's 1979 single &quot;Oh Susie&quot;/&quot;Give Me Your Love.&quot;
